import React, { Component } from "react";
import "./App.css";

import tareas from './ejemplo/tasks.json'; 
console.log(tareas);

class App extends Component{

  state = {
    tasks: tareas
  }

  render() {
    return <div>
      { this.state.tasks.map(e => <h1>{e.title}</h1>) }
    </div>
  }
}



export default App;
